INSERT INTO `tbl_mst_email_templates` (`email_template_id`, `email_template_title`, `email_template_subject`, `email_template_content`, `status`, `created_by`, `date_created`, `date_updated`) VALUES
(1, 'project-assigned', 'Project Assigned on glsinfra', '<p></p>\r\n\r\n<h1><strong>                   GLS Infra</strong></h1>\r\n\r\n<p>Dear ||FULL_NAME||,</p>\r\n\r\n<p>The project "||PROJECT_NAME||" has been assigned to you.</p>\r\n\r\n<p></p>\r\n\r\n<p>!@#$^Z)(*&^%</p>\r\n\r\n<p></p>\r\n\r\n<p>Regards,</p>\r\n\r\n<p>||SITE_TITLE||</p>\r\n\r\n<p><strong><strong></strong></strong></p>\r\n\r\n<p><strong><strong></strong></strong></p>\r\n\r\n<p></p>\r\n\r\n<p></p>\r\n', 'Active', 1, '2016-02-25 07:14:00', '2017-08-01 12:13:56'),
(2, 'payment-link-email-to-customer', 'Payment link for gls infra', '<p></p>\n\n<h1><strong>                   GLS Infra</strong></h1>\n\n<p></p>\n\n<p>Dear Valued Customer,</p>\n\n<p>Thank you for showing interest in gls infra. Use below link to make payment.</p>\n\n<p>||PAYMENT LINK||</p>\n\n<p></p>\n\n<p>Regards,</p>\n\n<p>||SITE_TITLE||</p>\n\n<p></p>\n', 'Active', NULL, NULL, '2017-07-25 08:59:38'),
(3, 'user-created-by-admin', 'You have been added on glsinfra', '<p></p>\r\n\r\n<h1><strong>                   GLS Infra</strong></h1>\r\n\r\n<p></p>\r\n\r\n<p>Dear ||FIRST_NAME|| ||LAST_NAME||,</p>\r\n\r\n<p>You have been added on gls infra as ||USER_TYPE|| . Use below credentials to l ogin.</p>\r\n\r\n<p>Link - ||LINK||</p>\r\n\r\n<p>Username - ||USERNAME||</p>\r\n\r\n<p>Password - ||PASSWORD||</p>\r\n\r\n<p></p>\r\n\r\n<p>Regards,</p>\r\n\r\n<p>||SITE_TITLE||</p>\r\n\r\n<p></p>\r\n', 'Active', NULL, NULL, '2017-07-25 09:11:03'),
(4, 'newsletter-subscription', 'You have subscribed to our newsletter', '<p>Hello ||USER_NAME||,</p>\n\n<p>You have successfully subscribed to our newsletter.</p>\n\n<p>To unsubscribe, click here:- &nbsp;||UNSUBSCRIBE_LINK||.</p>\n\n<p>Regards,</p>\n\n<p>||SITE_TITLE||</p>\n\n<p>||SITE_URL||</p>\n', 'Active', NULL, NULL, '2017-08-09 13:29:30'),
(5, 'newsletter-unsubscription', 'Unsubscribed successfully', '<p>Hello ||USER_NAME||,</p>\r\n\r\n<p>You have successfully unsubscribed to our newsletter.</p>\r\n\r\n<p>To unsubscribe, click here:- ||SUBSCRIBE_LINK||.</p>\r\n\r\n<p>Regards,</p>\r\n\r\n<p>||SITE_TITLE||</p>\r\n\r\n<p>||SITE_URL||</p>\r\n', 'Active', NULL, NULL, '2017-07-25 17:17:49');
