INSERT INTO `tbl_mst_newsletter` (`newsletter_id`, `newsletter_subject`, `newsletter_content`, `lang_id`, `newsletter_status`, `add_date`, `update_date`) VALUES
(1, 'test', '<p>test</p>\r\n', 0, '1', '2017-08-10', '0000-00-00'),
(2, '15 august', '<p>Simple Transactional Email</p>\r\n\r\n<table border="0" cellpadding="0" cellspacing="0" style="width:100%">\r\n	<tbody>\r\n		<tr>\r\n			<td style="vertical-align:top">&nbsp;</td>\r\n			<td style="vertical-align:top; width:580px"><!-- START CENTERED WHITE CONTAINER -->This is preheader text. Some clients will show this text as a preview.\r\n			<table style="width:100%"><!-- START MAIN CONTENT AREA -->\r\n				<tbody>\r\n					<tr>\r\n						<td style="vertical-align:top">\r\n						<table border="0" cellpadding="0" cellspacing="0" style="width:100%">\r\n							<tbody>\r\n								<tr>\r\n									<td style="vertical-align:top">\r\n									<p>Hi there,</p>\r\n\r\n									<p>Sometimes you just want to send a simple HTML email with a simple design and clear call to action. This is it.</p>\r\n\r\n									<table border="0" cellpadding="0" cellspacing="0" style="width:100%">\r\n										<tbody>\r\n											<tr>\r\n												<td style="vertical-align:top">\r\n												<table border="0" cellpadding="0" cellspacing="0" style="width:auto">\r\n													<tbody>\r\n														<tr>\r\n															<td style="background-color:#3498db; text-align:center; vertical-align:top"><a href="http://htmlemail.io" target="_blank">Call To Action</a></td>\r\n														</tr>\r\n													</tbody>\r\n												</table>\r\n												</td>\r\n											</tr>\r\n										</tbody>\r\n									</table>\r\n\r\n									<p>This is a really simple email template. Its sole purpose is to get the recipient to click the button with no distractions.</p>\r\n\r\n									<p>Good luck! Hope it works.</p>\r\n									</td>\r\n								</tr>\r\n							</tbody>\r\n						</table>\r\n						</td>\r\n					</tr>\r\n					<!-- END MAIN CONTENT AREA -->\r\n				</tbody>\r\n			</table>\r\n			<!-- START FOOTER -->\r\n\r\n			<table border="0" cellpadding="0" cellspacing="0" style="width:100%">\r\n				<tbody>\r\n					<tr>\r\n						<td style="text-align:center; vertical-align:top">Company Inc, 3 Abbey Road, San Francisco CA 94102<br />\r\n						Don&#39;t like these emails? <a href="http://i.imgur.com/CScmqnj.gif">Unsubscribe</a>.</td>\r\n					</tr>\r\n					<tr>\r\n						<td style="text-align:center; vertical-align:top">Powered by <a href="http://htmlemail.io">HTMLemail</a>.</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			<!-- END FOOTER --> <!-- END CENTERED WHITE CONTAINER --></td>\r\n			<td style="vertical-align:top">&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', 0, '1', '2017-08-10', '0000-00-00'),
